const fs = require('fs');
const path = require('path');
const { PDFDocument } = require('pdf-lib');
const Jimp = require('jimp');

async function imageToPDF(imageBase64) {
    try {
        // Decode base64 image
        const imageBuffer = Buffer.from(imageBase64, 'base64');
        const image = await Jimp.read(imageBuffer);
        const width = image.bitmap.width;
        const height = image.bitmap.height;

        // Create a new PDF document
        const pdfDoc = await PDFDocument.create();
        const page = pdfDoc.addPage([width, height]);

        // Convert image to PNG buffer
        const pngBuffer = await image.getBufferAsync(Jimp.MIME_PNG);

        // Embed the image in the PDF
        const embeddedImage = await pdfDoc.embedPng(pngBuffer);
        page.drawImage(embeddedImage, {
            x: 0,
            y: 0,
            width: width,
            height: height,
        });

        // Save the PDF with the same name as the input image
        const pdfName = path.basename(imageBase64, path.extname(imageBase64)) + '.pdf';
        const pdfBytes = await pdfDoc.save();
        fs.writeFileSync(pdfName, pdfBytes);

        console.log(`PDF saved as ${pdfName}`);
    } catch (error) {
        console.error('Error converting image to PDF:', error);
    }
}

// Example usage: Convert base64-encoded image to PDF with the same name
const imageBase64 = ""; // Replace with your base64-encoded image
imageToPDF(imageBase64);
